import React, { Component } from "react";
import Iframe from "react-iframe";

export default class Archrenderings extends Component {
  render() {
    return (
      <div>
        <div style="padding:56.25% 0 0 0;position:relative;">
          <iframe
            src="https://player.vimeo.com/video/364942210?autoplay=1&title=0&byline=0&portrait=0"
            style="position:absolute;top:0;left:0;width:100%;height:100%;"
            frameborder="0"
            allow="autoplay; fullscreen"
            allowfullscreen
          ></iframe>
        </div>

        <h1>park</h1>
      </div>
    );
  }
}
